import React, { useContext, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { AnswerContext } from '../AnswerContext';
import '../styles/MoodSelectionPage.css';

function MoodSelectionPage() {
    const navigate = useNavigate();
    const { answers, setAnswers } = useContext(AnswerContext);

    const [filters, setFilters] = useState({
        FQ1: '',
        FQ2: '',
        FQ3: '',
        FQ4: '',
        FQ5: '',
    });

    const handleFilterChange = (e) => {
        const { name, value } = e.target;
        setFilters(prev => ({ ...prev, [name]: value }));
    };

    const handleMoodSelect = (mood) => {
        const updatedAnswers = {
            ...answers,
            ...filters,
            Q1: mood === 'comedy' ? 1 : 0,
        };

        console.log("Setting answers in context:", updatedAnswers);
        setAnswers(updatedAnswers);

        if (mood === 'comedy') {
            navigate('/musical');
        } else {
            navigate('/storytelling');
        }
    };

    return (
        <div className="mood-selection">
            <h1>Answer a few filters before selecting mood</h1>

            <div className="filters">
                <label>
                    What is the age restriction?
                    <select name="FQ1" value={filters.FQ1} onChange={handleFilterChange}>
                        <option value="">-- Select --</option>
                        <option value=">=17">>=17</option>
                        <option value="<17">&lt;17</option>
                    </select>
                </label>

                <label>
                    When has the movie been released?
                    <select name="FQ2" value={filters.FQ2} onChange={handleFilterChange}>
                        <option value="">-- Select --</option>
                        <option value=">=2000">>=2000</option>
                        <option value="<2000">&lt;2000</option>
                    </select>
                </label>

                <label>
                    What rating category would you like?
                    <select name="FQ3" value={filters.FQ3} onChange={handleFilterChange}>
                        <option value="">-- Select --</option>
                        <option value=">=6">>=6</option>
                        <option value=">=8">>=8</option>
                    </select>
                </label>

                <label>
                    How long should the movie be?
                    <select name="FQ4" value={filters.FQ4} onChange={handleFilterChange}>
                        <option value="">-- Select --</option>
                        <option value="<120">&lt;120 min</option>
                        <option value=">=120">>=120 min</option>
                    </select>
                </label>

                <label>
                    Language the movie is dubbed in:
                    <select name="FQ5" value={filters.FQ5} onChange={handleFilterChange}>
                        <option value="">-- Select --</option>
                        <option value="English">English</option>
                        <option value="German">German</option>
                    </select>
                </label>
            </div>

            <div className="mood-buttons">
                <h2>Now select your mood:</h2>
                <button onClick={() => handleMoodSelect('comedy')}>Lighthearted and Comedic</button>
                <button onClick={() => handleMoodSelect('drama')}>Serious and Dramatic</button>
            </div>
        </div>
    );
}

export default MoodSelectionPage;
